// CHARITIES MODEL\nmodel Charities {\n  charity_id    Int      @id @default(autoincrement())\n  name          String\n  email         String   @unique\n  phone         String\n  address       String\n  website       String\n  verified      Boolean  @default(false)\n  created_on    DateTime @default(now())\n  updated_on    DateTime @updatedAt\n  password_hash String?\n\n  applications               CharityApplications[]\n  signup_tokens              CharitySignupTokens[]\n  // All donation requests answered by this charity\n  donation_requests_answered DonationRequest[]     @relation(\"charity_answer\")\n  // All donations accepted by this charity\n  donations_received         Donations[]           @relation(\"charity_donation\")\n\n  // Clothing items currently owned by this charity\n  ClothingItems ClothingItems[]\n\n  @@index([name])\n  @@index([email])\n}\n\n// CHARITY APPLICATIONS MODEL\nmodel CharityApplications {\n  application_id Int       @id @default(autoincrement())\n  org_name       String\n  contact_name   String\n  contact_email  String\n  contact_number String\n  website        String\n  org_address    String\n  charity_number String?\n  status         Status    @default(PENDING)\n  reviewed_on    DateTime?\n  reviewed_by    Int?\n  approved_on    DateTime?\n  approved_by    Int?\n  charity_id     Int?\n  created_on     DateTime  @default(now())\n  updated_on     DateTime  @updatedAt\n\n  approver User?      @relation(\"approved_by_admin\", fields: [approved_by], references: [user_id])\n  reviewer User?      @relation(\"reviewed_by_admin\", fields: [reviewed_by], references: [user_id])\n  charity  Charities? @relation(fields: [charity_id], references: [charity_id])\n\n  @@index([status, created_on])\n  @@index([contact_email])\n}\n\n// CHARITIES SIGNUP TOKENS\nmodel CharitySignupTokens {\n  invite_id   Int       @id @default(autoincrement())\n  charity_id  Int\n  email       String\n  token       String    @unique\n  expires_on  DateTime\n  consumed_on DateTime?\n  created_on  DateTime  @default(now())\n  created_by  Int?\n\n  charity Charities @relation(fields: [charity_id], references: [charity_id], onDelete: Cascade)\n  creator User?     @relation(\"invites_created_by\", fields: [created_by], references: [user_id])\n\n  @@index([charity_id, created_on])\n  @@index([email])\n}\n\n// DONATIONS (Finalised donation per request)\nmodel Donations {\n  donation_id         Int      @id @default(autoincrement())\n  donation_request_id Int      @unique\n  created_by          Int\n  accepted_by         Int\n  accepted_at         DateTime @default(now())\n\n  creator  User            @relation(\"donor_donation\", fields: [created_by], references: [user_id])\n  accepted Charities       @relation(\"charity_donation\", fields: [accepted_by], references: [charity_id])\n  request  DonationRequest @relation(fields: [donation_request_id], references: [donation_request_id])\n\n  // All clothing items included in this final donation\n  ClothingItems ClothingItems[]\n}\n\n// DONATION REQUEST (from donor)\nmodel DonationRequest {\n  donation_request_id Int      @id @default(autoincrement())\n  title               String\n  created_on          DateTime @default(now())\n  updated_on          DateTime @updatedAt\n\n  // Overall request status:\n  // PENDING  = waiting for charity decision\n  // APPROVED = accepted (at least some items accepted)\n  // REJECTED = entirely declined\n  status Status @default(PENDING)\n\n  // Charity that answered this request\n  answered_by Int?\n  // Donor who created it\n  created_by  Int\n\n  accepted_donation Donations?\n  clothing_items    ClothingItems[]\n\n  creator           User       @relation(\"donor_request\", fields: [created_by], references: [user_id])\n  answering_charity Charities? @relation(\"charity_answer\", fields: [answered_by], references: [charity_id])\n}\n\n// INDIVIDUAL CLOTHING ITEMS\nmodel ClothingItems {\n  clothing_id         Int    @id @default(autoincrement())\n  donation_request_id Int\n  type                String\n  size                String\n  condition           String\n  donor_id            Int\n  donation_id         Int?\n  owned_by            Int?\n\n  // Images\n  front_image_url String\n  back_image_url  String\n\n  // NEW: item-level review state\n  // PENDING = awaiting decision\n  // ACCEPTED = included in final donation\n  // DENIED = rejected by charity\n  status ItemStatus? @default(PENDING)\n\n  // Optional explanation of why this item was denied (if applicable)\n  denial_reason String?\n\n  donation_request DonationRequest @relation(fields: [donation_request_id], references: [donation_request_id])\n  donor            User            @relation(fields: [donor_id], references: [user_id])\n\n  // Charity that currently owns this item (if accepted)\n  owner    Charities? @relation(fields: [owned_by], references: [charity_id])\n  donation Donations? @relation(fields: [donation_id], references: [donation_id])\n}\n\n// CHARITY APPLICATION STATUS ENUM\nenum Status {\n  PENDING\n  APPROVED\n  REJECTED\n}\n\n// NEW: Clothing item-level status enum\nenum ItemStatus {\n  PENDING // Not yet reviewed\n  ACCEPTED // Accepted into the charityâ€™s inventory / donation\n  DENIED // Rejected item\n}\n",
